script: |
  super -f text -I q6685.spq | sort > q6685.out

inputs:
  - name: q6685.spq
    data: |
      SELECT DISTINCT + 16 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( + + col0 ) / 69 * - + col2 NOT BETWEEN - + 54 AND col1 + + col2;
  - name: tab2

outputs:
  - name: q6685.out
    data: |
      16
